/* B1 */
SELECT od.OrderID, od.Quantity, p.ProductID, p.ReorderLevel, s.SupplierID
FROM OrderDetails od
JOIN Products p ON od.ProductID = p.ProductID
JOIN Suppliers s ON p.SupplierID = s.SupplierID
WHERE od.Quantity BETWEEN 90 AND 100
ORDER BY od.OrderID;

/* B2 */
SELECT ProductID, ProductName, EnglishName, FORMAT(UnitPrice, 'C', 'en-US') AS UnitPrice
FROM Products
WHERE UnitPrice < 10
ORDER BY ProductID;

/* B3 */
SELECT CustomerID, CompanyName, Country, Phone 
FROM Customers 
WHERE Country IN ('Canada', 'USA') 
ORDER BY CompanyName;

/* B4 */
SELECT s.SupplierID, s.Name, p.ProductName, p.ReorderLevel, p.UnitsInStock
FROM Suppliers s
JOIN Products p ON p.SupplierID = s.SupplierID
WHERE p.UnitsInStock > p.ReorderLevel AND p.UnitsInStock <= p.ReorderLevel + 10
ORDER BY p.ProductName;

/* B5 */
SELECT c.CompanyName, COUNT(o.OrderID) AS Amount
FROM Customers c
JOIN Orders o ON c.CustomerID = o.CustomerID
WHERE o.OrderDate >= '1993-12-01' AND o.OrderDate <='1993-12-31'
GROUP BY c.CompanyName
ORDER BY c.CompanyName;

/* B6 */
SELECT TOP 10
p.ProductName, COUNT(od.OrderID) AS Amount
FROM OrderDetails od
JOIN Products p ON od.ProductID = p.ProductID
GROUP BY p.ProductID, p.ProductName
ORDER BY Amount DESC;

/* B7 */
SELECT TOP 10
p.ProductName, SUM(od.Quantity) AS Quantity
FROM OrderDetails od
JOIN Products p ON od.ProductID = p.ProductID
GROUP BY p.ProductName
ORDER BY Quantity DESC;

/* B8 */
SELECT o.OrderID, FORMAT(od.UnitPrice, 'C', 'en-US') AS UnitPrice, od.Quantity 
FROM OrderDetails od
JOIN Orders o ON od.OrderID = o.OrderID
WHERE o.ShipCity = 'Vancouver'
ORDER BY o.OrderID;

/* B9 */
SELECT c.CustomerID, c.CompanyName, o.OrderID, FORMAT(o.OrderDate, 'MMMM ') + 
       CAST(DAY(o.OrderDate) AS VARCHAR) + 
       ', ' + 
       CAST(YEAR(o.OrderDate) AS VARCHAR) AS OrderDate
FROM Customers c
JOIN Orders o ON c.CustomerID = o.CustomerID
WHERE o.ShippedDate IS NULL
ORDER BY c.CustomerID,o.OrderDate; 

/* B10 */
SELECT 
p.ProductID, p.ProductName, p.QuantityPerUnit, FORMAT(p.UnitPrice, 'C', 'en-US') AS UnitPrice
FROM Products p
WHERE p.ProductName LIKE '%choc%' OR p.ProductName LIKE '%chok%'
ORDER BY ProductName;

/* B11 */
SELECT 
LEFT(p.ProductName, 1) AS Character, COUNT(*) AS Total
FROM Products p
GROUP BY LEFT(p.ProductName, 1)
HAVING COUNT(*) > 1
ORDER BY Character;
