CREATE OR ALTER PROCEDURE UnitPriceByRange(@lowerPrice MONEY, @upperPrice MONEY) 
AS 
BEGIN
    SELECT 
        ProductID, 
        ProductName, 
        EnglishName, 
        FORMAT(UnitPrice, 'C', 'en-US') AS UnitPrice
    FROM 
        (SELECT ProductID, ProductName, EnglishName, UnitPrice
         FROM Products
         WHERE UnitPrice BETWEEN @lowerPrice AND @upperPrice) AS SubQuery
    ORDER BY SubQuery.UnitPrice;
END;
