CREATE OR ALTER PROCEDURE OrdersByDates(@startDate SMALLDATETIME, @endDate SMALLDATETIME ) 
AS 
BEGIN
	SELECT o.OrderID, c.CompanyName AS Customer, s.CompanyName AS Shipper, FORMAT(o.ShippedDate, 'MMMM d, yyyy') AS ShippedDate
	FROM Orders o JOIN Customers c 
	ON c.CustomerID = o.CustomerID
	JOIN Shippers s
	ON s.ShipperID = o.ShipperID
	WHERE o.ShippedDate BETWEEN @startDate AND @endDate
	ORDER BY o.ShippedDate
END
GO

