CREATE OR ALTER PROCEDURE ProductsByMonthAndYear(@englishName NVARCHAR(40), @month NVARCHAR(40), @year INT ) 
AS 
BEGIN
	SELECT DISTINCT
	p.EnglishName, FORMAT(p.UnitPrice, 'C', 'en-US') AS UnitPrice, p.UnitsInStock, s.Name
	FROM Products p JOIN Suppliers s 
	ON p.SupplierID = s.SupplierID
	JOIN OrderDetails od 
	ON p.ProductID = od.ProductID
    JOIN Orders o 
	ON od.OrderID = o.OrderID
	WHERE 
	p.EnglishName LIKE @englishName
	AND FORMAT(o.OrderDate, 'MMMM', 'en-US') = @month
	AND YEAR(o.OrderDate) = @year
END
GO

