CREATE OR ALTER PROCEDURE ReorderQuantity(@unitValue SMALLINT) 
AS 
BEGIN
	SELECT
	p.ProductID, p.ProductName, s.Name, p.UnitsInStock, p.ReorderLevel
	FROM Products p JOIN Suppliers s 
	ON p.SupplierID = s.SupplierID
