CREATE OR ALTER PROCEDURE ShippingDelay(@cutoffDate SMALLDATETIME) 
AS 
BEGIN
	SELECT
	o.OrderID, c.CompanyName AS CustomerName, s.CompanyName AS ShipperName, 
	FORMAT(o.OrderDate, 'MMMM d, yyyy') AS OrderDate,
	FORMAT(o.RequiredDate, 'MMMM d, yyyy') AS RequiredDate,
	FORMAT(o.ShippedDate, 'MMMM d, yyyy') AS ShippedDate,
	CASE
		WHEN o.ShippedDate IS NOT NULL AND o.ShippedDate > o.RequiredDate
        THEN DATEDIFF(DAY, o.RequiredDate, o.ShippedDate)
        ELSE 0 
	END AS DaysDelayedBy
	FROM Orders o JOIN Customers c 
	ON c.CustomerID = o.CustomerID
	JOIN Shippers s
	ON s.ShipperID = o.ShipperID
	WHERE 
		o.OrderDate > @cutoffDate  AND
		o.ShippedDate IS NOT NULL AND 
		o.ShippedDate > o.RequiredDate
	ORDER BY o.OrderDate 
END
GO

