IF EXISTS (SELECT * FROM sys.triggers WHERE name = 'InsertShippers')
BEGIN
    DROP TRIGGER InsertShippers;
END
GO

CREATE TRIGGER InsertShippers
ON Shippers 
INSTEAD OF INSERT
AS
BEGIN
	SET XACT_ABORT OFF;
	BEGIN TRY
		BEGIN TRANSACTION Trans1;
		IF EXISTS(
			SELECT * FROM Shippers 
			WHERE CompanyName IN (
				SELECT CompanyName FROM inserted
			)
		)
		BEGIN
			RAISERROR('A shipper with the same company name already exists.', 16, 1);
			ROLLBACK TRANSACTION Trans1;
			RETURN;
		END

		SELECT ShipperID, CompanyName FROM inserted;
		COMMIT TRANSACTION Trans1;
	END TRY
	BEGIN CATCH
		IF @@TRANCOUNT > 0
		BEGIN
			ROLLBACK TRANSACTION Trans1;
		END
		DECLARE @ErrMsg NVARCHAR(4000), @ErrSeverity INT;
        SELECT @ErrMsg = ERROR_MESSAGE(), @ErrSeverity = ERROR_SEVERITY();
        RAISERROR(@ErrMsg, @ErrSeverity, 1);
	END CATCH
END;
GO

