IF EXISTS (SELECT * FROM sys.triggers WHERE name = 'CheckQuantity')
BEGIN
    DROP TRIGGER CheckQuantity;
END
GO

CREATE TRIGGER CheckQuantity
ON OrderDetails 
INSTEAD OF INSERT, UPDATE
AS
BEGIN
	SET XACT_ABORT OFF;
	BEGIN TRY
        BEGIN TRANSACTION;

        IF EXISTS(
            SELECT 1
            FROM inserted i
            INNER JOIN dbo.Products p ON i.ProductID = p.ProductID
            WHERE i.Quantity > p.UnitsInStock
        )
        BEGIN
			DECLARE @maxStock INT, @requestedQty INT;
			SELECT TOP 1 @maxStock = p.UnitsInStock, @requestedQty = i.Quantity
			FROM inserted i
			INNER JOIN dbo.Products p ON i.ProductID = p.ProductID
			WHERE i.Quantity > p.UnitsInStock;

			DECLARE @ErrorMsg NVARCHAR(4000) = CONCAT('Ordered: ', @requestedQty, '; available: ', @maxStock);
			RAISERROR(@ErrorMsg, 16, 1);
			ROLLBACK TRANSACTION;
			RETURN;
		END

        SELECT OrderID, ProductID, UnitPrice, Quantity, Discount
        FROM inserted
		WHERE NOT EXISTS (
            SELECT 1 FROM dbo.OrderDetails WHERE OrderID = inserted.OrderID AND ProductID = inserted.ProductID
        );

        UPDATE od
        SET od.UnitPrice = i.UnitPrice,
            od.Quantity = i.Quantity,
            od.Discount = i.Discount
        FROM dbo.OrderDetails od
        JOIN inserted i ON od.OrderID = i.OrderID AND od.ProductID = i.ProductID
		WHERE EXISTS (
            SELECT 1 FROM dbo.OrderDetails WHERE OrderID = i.OrderID AND ProductID = i.ProductID
        );
        COMMIT TRANSACTION;
    END TRY
    BEGIN CATCH
        IF @@TRANCOUNT > 0
            ROLLBACK TRANSACTION;
        DECLARE @ErrMsg NVARCHAR(4000), @ErrSeverity INT;
        SELECT @ErrMsg = ERROR_MESSAGE(), @ErrSeverity = ERROR_SEVERITY();
        RAISERROR(@ErrMsg, @ErrSeverity, 1);
    END CATCH
END;
GO

